import React from "react";
import { makeStyles } from '@material-ui/core/styles';
import Typography from '@material-ui/core/Typography';
import classNames from "classnames";
import VendorDashboard from "../VendorDashboard/VendorDashboard";
import { Link } from 'react-router-dom';
import { Grid } from "@material-ui/core";
import { Card, CardContent } from "@material-ui/core";
import WarningIcon from '@material-ui/icons/Warning';
import PeopleIcon from '@material-ui/icons/People';
import { Box } from "@material-ui/core";

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },
  appBar: {
    width: `calc(100% - ${drawerWidth}px)`,
    marginLeft: drawerWidth,
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
  },
  drawerPaper: {
    width: drawerWidth,
  },
  // necessary for content to be below app bar
  toolbar: theme.mixins.toolbar,
  content: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.default,
    padding: theme.spacing(3),
  },
  dateRange : {
    marginTop: 50,
    marginBottom: 50
  },
  title: {
    color: "#00000",
    fontSize: 20,
    fontWeight: 600, // or 'bold'
    margin:20
  },
  customContainer: {
    paddingLeft: 84,
    paddingRight: 84,
    marginTop:100
  }
}));

export default function VendorDashboardHome() {
  const classes = useStyles();
  return (
    <div className={classes.root}>

      <VendorDashboard/> 
      <main className={classes.content}>
      <Grid container alignItems="stretch"
       display="flex"
       flexDirection= "column"
       // Justify the content so that CardContent will always be at the top of the card,
       // and CardActions will be at the bottom
       justifyContent= "space-between">

        <Grid item component={Card} xs>
                <CardContent>
                 Card A content
                </CardContent>
            </Grid>

            <Grid item component={Card} xs>
                <CardContent>
                 Card B content
                </CardContent>
            </Grid>

            <Grid item component={Card} xs>
                <CardContent>
                 Card B content
                </CardContent>
            </Grid>
            </Grid>
        <Box p={1} bgcolor="#FFAA06" borderRadius={10} component={ Link } to="/vendor/currentOrders">
          <Card >
          <CardContent>
          <Typography align="center" className={classNames(classes.title)} >
            Current Orders
          </Typography>
          <WarningIcon />
          </CardContent>
          </Card>
        </Box>
        <Box p={1} bgcolor="#FFAA06" borderRadius={10} component={ Link } to="/vendor/pastOrders">
          <Card >
          <CardContent>
          <Typography align="center" className={classNames(classes.title)} >
           Past Orders
          </Typography>
          <PeopleIcon />
          </CardContent>
          </Card>
        </Box> 


      </main>
    </div>
  );
}
